(193, 1, 1184918, 'The Wild Robot123', 'After a shipwreck, an intelligent robot called Roz is stranded on an uninhabited island. To survive the harsh environment, Roz bonds with the island\'s animals and cares for an orphaned baby goose.', 4473.7, '2024-09-12', 8.615, 'https://image.tmdb.org/t/p/original/undefined', 'https://image.tmdb.org/t/p/original/https://image.tmdb.org/t/p/original//9w0Vh9eizfBXrcomiaFWTIPdboo.jpg', 0, '2024-10-19 07:51:06', '0000-00-00 00:00:00'),
(194, 2, 505642, 'Black Panther: Wakanda Forever', 'Queen Ramonda, Shuri, M’Baku, Okoye and the Dora Milaje fight to protect their nation from intervening world powers in the wake of King T’Challa’s death.  As the Wakandans strive to embrace their next chapter, the heroes must band together with the help of War Dog Nakia and Everett Ross and forge a new path for the kingdom of Wakanda.', 97.184, '2022-11-09', 7.1, 'https://image.tmdb.org/t/p/original//uu4On1xXiiDGeYwHSbp7BSQBTGv.jpg', 'https://image.tmdb.org/t/p/original//sv1xJUazXeYqALzczSZ3O6nkH75.jpg', 0, '2024-12-20 12:57:43', '0000-00-00 00:00:00'),
(196, 2, 672, 'Harry Potter and the Chamber of Secrets', 'Cars fly, trees fight back, and a mysterious house-elf comes to warn Harry Potter at the start of his second year at Hogwarts. Adventure and danger await when bloody writing on a wall announces: The Chamber Of Secrets Has Been Opened. To save Hogwarts will require all of Harry, Ron and Hermione’s magical abilities and courage.', 177.108, '2002-11-13', 7.7, 'https://image.tmdb.org/t/p/original//yHzyPJrVqlTySQ9mc379yxrLBYQ.jpg', 'https://image.tmdb.org/t/p/original//sdEOH0992YZ0QSxgXNIGLq1ToUi.jpg', 0, '2024-12-20 13:04:25', '0000-00-00 00:00:00'),
(197, 2, 12445, 'Harry Potter and the Deathly Hallows: Part 2', 'Harry, Ron and Hermione continue their quest to vanquish the evil Voldemort once and for all. Just as things begin to look hopeless for the young wizards, Harry discovers a trio of magical objects that endow him with powers to rival Voldemort\'s formidable skills.', 118.591, '2011-07-12', 8.092, 'https://image.tmdb.org/t/p/original//n5A7brJCjejceZmHyujwUTVgQNC.jpg', 'https://image.tmdb.org/t/p/original//c54HpQmuwXjHq2C9wmoACjxoom3.jpg', 0, '2024-12-20 13:12:04', '0000-00-00 00:00:00'),
(198, 2, 12444, 'Harry Potter and the Deathly Hallows: Part 1', 'Harry, Ron and Hermione walk away from their last year at Hogwarts to find and destroy the remaining Horcruxes, putting an end to Voldemort\'s bid for immortality. But with Harry\'s beloved Dumbledore dead and Voldemort\'s unscrupulous Death Eaters on the loose, the world is more dangerous than ever.', 123.907, '2010-11-17', 7.747, 'https://image.tmdb.org/t/p/original//AqLcLsGGTzAjm3pCCq0CZCQrp6m.jpg', 'https://image.tmdb.org/t/p/original//iGoXIpQb7Pot00EEdwpwPajheZ5.jpg', 0, '2024-12-20 13:15:53', '0000-00-00 00:00:00'),
(199, 2, 673, 'Harry Potter and the Prisoner of Azkaban', 'Year three at Hogwarts means new fun and challenges as Harry learns the delicate art of approaching a Hippogriff, transforming shape-shifting Boggarts into hilarity and even turning back time. But the term also brings danger: soul-sucking Dementors hover over the school, an ally of the accursed He-Who-Cannot-Be-Named lurks within the castle walls, and fearsome wizard Sirius Black escapes Azkaban. And Harry will confront them all.', 153.657, '2004-05-31', 8.016, 'https://image.tmdb.org/t/p/original//htmYEfH7TQgzsXHCnNXxmoYKQtL.jpg', 'https://image.tmdb.org/t/p/original//aWxwnYoe8p2d2fcxOqtvAtJ72Rw.jpg', 0, '2024-12-20 13:20:03', '0000-00-00 00:00:00'),
(200, 2, 497582, 'Enola Holmes', 'While searching for her missing mother, intrepid teen Enola Holmes uses her sleuthing skills to outsmart big brother Sherlock and help a runaway lord.', 26.314, '2020-09-23', 7.27, 'https://image.tmdb.org/t/p/original//kMe4TKMDNXTKptQPAdOF0oZHq3V.jpg', 'https://image.tmdb.org/t/p/original//riYInlsq2kf1AWoGm80JQW5dLKp.jpg', 0, '2024-12-20 13:25:19', '0000-00-00 00:00:00'),
(201, 2, 581530, '시동', 'Two boys are becoming real adults during a turbulent time as they experience a world that doesn\'t go their way.', 7.619, '2019-12-18', 6.9, 'https://image.tmdb.org/t/p/original//ngzOH1Sjk3Ax5cY1ivqU9OIsMRF.jpg', 'https://image.tmdb.org/t/p/original//1t0xyMPry61yQfdyb7hxxoHvL6a.jpg', 0, '2024-12-20 13:31:40', '0000-00-00 00:00:00'),
(202, 2, 509080, 'LEGO Marvel Super Heroes: Guardians of the Galaxy - The Thanos Threat', 'The Guardians are on a mission to deliver the Build Stone to the Avengers before the Ravagers, Thanos and his underlings steal it from them.', 8.92, '2017-12-09', 6.7, 'https://image.tmdb.org/t/p/original//hkllv8JmO3UuRNKSiIfks5plhgi.jpg', 'https://image.tmdb.org/t/p/original//e5h1RlnQzjgEAh4s96k50S8XkKa.jpg', 0, '2024-12-20 13:35:20', '0000-00-00 00:00:00'),
(203, 2, 10195, 'Thor', 'Against his father Odin\'s will, The Mighty Thor - a powerful but arrogant warrior god - recklessly reignites an ancient war. Thor is cast down to Earth and forced to live among humans as punishment. Once here, Thor learns what it takes to be a true hero when the most dangerous villain of his world sends the darkest forces of Asgard to invade Earth.', 69.259, '2011-04-21', 6.77, 'https://image.tmdb.org/t/p/original//jWAJlgICJbn2kyohrokteRoD3cZ.jpg', 'https://image.tmdb.org/t/p/original//prSfAi1xGrhLQNxVSUFh61xQ4Qy.jpg', 0, '2024-12-20 13:37:44', '0000-00-00 00:00:00'),
(204, 2, 338953, 'Fantastic Beasts: The Secrets of Dumbledore', 'Professor Albus Dumbledore knows the powerful, dark wizard Gellert Grindelwald is moving to seize control of the wizarding world. Unable to stop him alone, he entrusts magizoologist Newt Scamander to lead an intrepid team of wizards and witches. They soon encounter an array of old and new beasts as they clash with Grindelwald\'s growing legion of followers.', 64.656, '2022-04-06', 6.7, 'https://image.tmdb.org/t/p/original//zGLHX92Gk96O1DJvLil7ObJTbaL.jpg', 'https://image.tmdb.org/t/p/original//3c5GNLB4yRSLBby0trHoA1DSQxQ.jpg', 0, '2024-12-20 13:55:08', '0000-00-00 00:00:00'),
(205, 2, 616037, 'Thor: Love and Thunder', 'After his retirement is interrupted by Gorr the God Butcher, a galactic killer who seeks the extinction of the gods, Thor Odinson enlists the help of King Valkyrie, Korg, and ex-girlfriend Jane Foster, who now wields Mjolnir as the Mighty Thor. Together they embark upon a harrowing cosmic adventure to uncover the mystery of the God Butcher’s vengeance and stop him before it’s too late.', 88.865, '2022-07-06', 6.44, 'https://image.tmdb.org/t/p/original//jsoz1HlxczSuTx0mDl2h0lxy36l.jpg', 'https://image.tmdb.org/t/p/original//pIkRyD18kl4FhoCNQuWxWu5cBLM.jpg', 0, '2024-12-20 17:50:10', '0000-00-00 00:00:00'),
(206, 2, 497582, 'Enola Holmes', 'While searching for her missing mother, intrepid teen Enola Holmes uses her sleuthing skills to outsmart big brother Sherlock and help a runaway lord.', 26.314, '2020-09-23', 7.27, 'https://image.tmdb.org/t/p/original//kMe4TKMDNXTKptQPAdOF0oZHq3V.jpg', 'https://image.tmdb.org/t/p/original//riYInlsq2kf1AWoGm80JQW5dLKp.jpg', 0, '2024-12-20 18:27:55', '0000-00-00 00:00:00'),
(207, 2, 259316, 'Fantastic Beasts and Where to Find Them', 'In 1926, Newt Scamander arrives at the Magical Congress of the United States of America with a magically expanded briefcase, which houses a number of dangerous creatures and their habitats. When the creatures escape from the briefcase, it sends the American wizarding authorities after Newt, and threatens to strain even further the state of magical and non-magical relations.', 68.339, '2016-11-16', 7.32, 'https://image.tmdb.org/t/p/original//8Qsr8pvDL3s1jNZQ4HK1d1Xlvnh.jpg', 'https://image.tmdb.org/t/p/original//h6NYfVUyM6CDURtZSnBpz647Ldd.jpg', 0, '2024-12-20 18:33:18', '0000-00-00 00:00:00'),
(208, 2, 338952, 'Fantastic Beasts: The Crimes of Grindelwald', 'Gellert Grindelwald has escaped imprisonment and has begun gathering followers to his cause—elevating wizards above all non-magical beings. The only one capable of putting a stop to him is the wizard he once called his closest friend, Albus Dumbledore. However, Dumbledore will need to seek help from the wizard who had thwarted Grindelwald once before, his former student Newt Scamander, who agrees to help, unaware of the dangers that lie ahead. Lines are drawn as love and loyalty are tested, even among the truest friends and family, in an increasingly divided wizarding world.', 34.073, '2018-11-14', 6.855, 'https://image.tmdb.org/t/p/original//qrtRKRzoNkf5vemO9tJ2Y4DrHxQ.jpg', 'https://image.tmdb.org/t/p/original//fMMrl8fD9gRCFJvsx0SuFwkEOop.jpg', 0, '2024-12-20 18:46:54', '0000-00-00 00:00:00'),
(209, 2, 70160, 'The Hunger Games', 'Every year in the ruins of what was once North America, the nation of Panem forces each of its twelve districts to send a teenage boy and girl to compete in the Hunger Games.  Part twisted entertainment, part government intimidation tactic, the Hunger Games are a nationally televised event in which “Tributes” must fight with one another until one survivor remains.  Pitted against highly-trained Tributes who have prepared for these Games their entire lives, Katniss is forced to rely upon her sharp instincts as well as the mentorship of drunken former victor Haymitch Abernathy.  If she’s ever to return home to District 12, Katniss must make impossible choices in the arena that weigh survival against humanity and life against love. The world will be watching.', 46.151, '2012-03-12', 7.213, 'https://image.tmdb.org/t/p/original//3kz6mLESBmdxAJwoHMS5YYfoWLE.jpg', 'https://image.tmdb.org/t/p/original//yXCbOiVDCxO71zI7cuwBRXdftq8.jpg', 0, '2024-12-20 20:16:43', '0000-00-00 00:00:00');
